r=A.P("En BabyCare, nos tomamos muy en serio la privacidad de tus datos y los de tu beb\xe9. Esta Pol\xedtica de Privacidad explica c\xf3mo recopilamos, usamos, protegemos y compartimos tu informaci\xf3n personal.",a0,a0,a0,A.aT(a0,a0,B.b2,a0,a0,a0,a0,a0,a0,a0,a0,15,a0,a0,a0,a0,1.7,!0,a0,0.2,a0,a0,a0,a0,a0,a0),a0,a0,a0)
p=a.iu("1. Informaci\xf3n que Recopilamos","Recopilamos diferentes tipos de informaci\xf3n para proporcionarte nuestros servicios:\n\n**Informaci\xf3n de cuenta:**\n\u2022 Nombre completo\n\u2022 Direcci\xf3n de correo electr\xf3nico\n\u2022 Contrase\xf1a (encriptada con Argon2)\n\n**Informaci\xf3n del beb\xe9:**\n\u2022 Nombre del beb\xe9\n\u2022 Fecha de nacimiento\n\u2022 Fotograf\xedas (opcional)\n\u2022 Registros de actividades (alimentaci\xf3n, sue\xf1o, cambios de pa\xf1al, salud)\n\n**Informaci\xf3n de uso:**\n\u2022 Datos de interacci\xf3n con la aplicaci\xf3n\n\u2022 Preferencias de configuraci\xf3n\n\u2022 Informaci\xf3n del dispositivo (modelo, sistema operativo)")
o=a.iu("2. C\xf3mo Usamos tu Informaci\xf3n","Utilizamos tu informaci\xf3n personal para:\n\n\u2022 Proporcionar y mantener nuestros servicios\n\u2022 Crear y gestionar tu cuenta\n\u2022 Permitir el registro y seguimiento de actividades del beb\xe9\n\u2022 Generar estad\xedsticas e insights personalizados\n\u2022 Mejorar la experiencia del usuario\n\u2022 Enviar notificaciones importantes sobre el servicio\n\u2022 Responder a tus consultas y proporcionar soporte t\xe9cnico\n\u2022 Cumplir con obligaciones legales")
n=a.iu("3. Base Legal para el Procesamiento","Procesamos tu informaci\xf3n personal bas\xe1ndonos en:\n\n\u2022 **Consentimiento:** Has aceptado que procesemos tu informaci\xf3n\n\u2022 **Contrato:** Necesario para proporcionar los servicios que solicitaste\n\u2022 **Inter\xe9s leg\xedtimo:** Para mejorar nuestros servicios y seguridad\n\u2022 **Obligaci\xf3n legal:** Cuando sea requerido por ley")
m=a.iu("4. Compartir tu Informaci\xf3n","BabyCare NO vende tu informaci\xf3n personal a terceros.\n\nCompartimos informaci\xf3n solo en estas circunstancias:\n\n**Con cuidadores autorizados:**\n\u2022 Cuando invites a otros cuidadores a acceder a la informaci\xf3n del beb\xe9\n\u2022 Los cuidadores solo ver\xe1n informaci\xf3n del beb\xe9 espec\xedfico\n\n**Proveedores de servicios:**\n\u2022 Servicios de hosting (Render, Supabase)\n\u2022 Servicio de email (SendGrid)\n\u2022 Estos proveedores tienen obligaciones contractuales de proteger tus datos\n\n**Requisitos legales:**\n\u2022 Cuando sea requerido por ley\n\u2022 Para proteger nuestros derechos legales\n\u2022 En caso de emergencia que afecte la seguridad")
l=a.iu("5. Seguridad de los Datos","Implementamos medidas de seguridad robustas:\n\n\u2022 **Encriptaci\xf3n:** Todas las contrase\xf1as se cifran con Argon2\n\u2022 **Conexiones seguras:** Usamos HTTPS para todas las comunicaciones\n\u2022 **Acceso limitado:** Solo personal autorizado puede acceder a datos sensibles\n\u2022 **Auditor\xedas regulares:** Revisamos y actualizamos nuestras pr\xe1cticas de seguridad\n\u2022 **Copias de seguridad:** Realizamos backups regulares para prevenir p\xe9rdida de datos\n\nSin embargo, ning\xfan sistema es 100% seguro. Te recomendamos usar contrase\xf1as fuertes y \xfanicas.")
k=a.iu("6. Almacenamiento y Retenci\xf3n de Datos","**Ubicaci\xf3n del almacenamiento:**\nTus datos se almacenan en servidores seguros proporcionados por Supabase y Render.\n\n**Tiempo de retenci\xf3n:**\n\u2022 Mantenemos tu informaci\xf3n mientras tu cuenta est\xe9 activa\n\u2022 Puedes solicitar la eliminaci\xf3n de tu cuenta en cualquier momento\n\u2022 Tras la eliminaci\xf3n, conservamos algunos datos durante 30 d\xedas para permitir recuperaci\xf3n\n\u2022 Despu\xe9s de 30 d\xedas, eliminamos permanentemente todos tus datos\n\u2022 Algunos datos pueden conservarse m\xe1s tiempo si es requerido por ley")
j=a.iu("7. Tus Derechos","Tienes los siguientes derechos sobre tu informaci\xf3n personal:\n\n**Derecho de acceso:** Puedes solicitar una copia de tus datos\n\n**Derecho de rectificaci\xf3n:** Puedes corregir informaci\xf3n inexacta\n\n**Derecho de eliminaci\xf3n:** Puedes solicitar que eliminemos tus datos\n\n**Derecho de portabilidad:** Puedes exportar tus datos en formato PDF\n\n**Derecho de oposici\xf3n:** Puedes oponerte a ciertos procesamientos\n\n**Derecho de limitaci\xf3n:** Puedes solicitar que limitemos el procesamiento\n\nPara ejercer estos derechos, contacta con nosotros en babycaretfg@gmail.com")
i=a.iu("8. Privacidad de Menores","BabyCare est\xe1 dise\xf1ado para ser usado por adultos (mayores de 18 a\xf1os) responsables del cuidado de beb\xe9s.\n\n\u2022 No recopilamos intencionalmente informaci\xf3n de menores de 18 a\xf1os\n\u2022 La informaci\xf3n del beb\xe9 es proporcionada por los padres/cuidadores\n\u2022 Los padres/cuidadores son responsables de la veracidad de la informaci\xf3n\n\u2022 Si descubrimos que hemos recopilado datos de un menor sin autorizaci\xf3n, los eliminaremos")
h=a.iu("9. Cookies y Tecnolog\xedas Similares","Utilizamos tecnolog\xedas de almacenamiento local para:\n\n\u2022 Mantener tu sesi\xf3n iniciada\n\u2022 Recordar tus preferencias\n\u2022 Mejorar el rendimiento de la aplicaci\xf3n\n\nPuedes controlar el almacenamiento local en la configuraci\xf3n de tu dispositivo.")
g=a.iu("10. Transferencias Internacionales","Tus datos pueden ser transferidos y procesados en pa\xedses distintos al tuyo. Nos aseguramos de que:\n\n\u2022 Existan garant\xedas adecuadas de protecci\xf3n\n\u2022 Se cumplan las regulaciones de protecci\xf3n de datos aplicables\n\u2022 Los proveedores cumplan con est\xe1ndares internacionales")
f=a.iu("11. Cambios a esta Pol\xedtica","Podemos actualizar esta Pol\xedtica de Privacidad peri\xf3dicamente para reflejar:\n\n\u2022 Cambios en nuestras pr\xe1cticas\n\u2022 Nuevas regulaciones legales\n\u2022 Mejoras en nuestros servicios\n\nTe notificaremos sobre cambios significativos mediante:\n\u2022 Email a tu direcci\xf3n registrada\n\u2022 Notificaci\xf3n en la aplicaci\xf3n\n\u2022 Actualizaci\xf3n de la fecha en la parte superior\n\nTe recomendamos revisar esta pol\xedtica peri\xf3dicamente.")
e=a.iu("12. Cumplimiento Legal","BabyCare cumple con:\n\n\u2022 Reglamento General de Protecci\xf3n de Datos (GDPR) - Uni\xf3n Europea\n\u2022 Ley Org\xe1nica de Protecci\xf3n de Datos (LOPD) - Espa\xf1a\n\u2022 Otras regulaciones de privacidad aplicables\n\nNos comprometemos a mantener el cumplimiento con las leyes de protecci\xf3n de datos vigentes.")
d=a.iu("13. Contacto","Para preguntas sobre esta Pol\xedtica de Privacidad o sobre c\xf3mo manejamos tus datos:\n\n**Email:** babycaretfg@gmail.com\n\nResponderemos a todas las consultas en un plazo m\xe1ximo de 48 horas.\n\nSi no est\xe1s satisfecho con nuestra respuesta, tienes derecho a presentar una queja ante la Agencia Espa\xf1ola de Protecci\xf3n de Datos (AEPD).")
